// react
import React, { Component } from 'react';

// third-party
import { Helmet } from 'react-helmet';
import {
    BrowserRouter,
    Route,
    Redirect,
    Switch,
} from 'react-router-dom';


// application
import Routes from './../Routes';
import Footer from './../../footer';
import Header from './../../header';
import QuickSearch from './QuickSearch';
import SearchMenu from './SearchMenu';

// pages
import { SearchCriterias } from './search-criterias/SearchCriterias';
import { SearchCustom } from './search-custom/SearchCustom';
import { SearchGeneral } from './search-general/SearchGeneral';
import { SearchGenericArticle } from './search-generic-article/SearchGenericArticle';
import { SearchManufacturer } from './search-manufacturer/SearchManufacturer';
import { SearchTyre } from './search-tyre/SearchTyre';
import { SearchUniversal } from './search-universal/SearchUniversal';
import { SearchVehicles } from './search-vehicles/SearchVehicles';

export class SearchLayout extends Component {
    render() {
        return (
            <React.Fragment>
                <Helmet>
                    <title>Drugi test</title>
                    <meta name="description" content="drugi test desc" />
                </Helmet>

                <div className="ekat__main">
                    <header className="ekat__header">
                        <Header />
                    </header>

                    <div className="ekat__body">
                        <div className="ekat__search">
                            <div className="ekat__quick-search">
                                <QuickSearch />
                            </div>
                            <div className="ekat__search-container">
                                <div className="ekat__search-menu">
                                    <SearchMenu />
                                </div>
                                <div className="ekat__search-body">
                                    <div className="search-body">
                                        <section className="breadcrumb-section">
                                            
                                        </section>

                                        <section className="search-section">
                                            <div className="search-main">
                                                {/* Left column */}
                                                <div className="search__banner-container">
                                                    Left banner
                                                </div>

                                                {/*pages*/}
                                                <Switch>
                                                    <Routes exact path='/search/search-criterias' component={SearchCriterias} layout={SearchLayout} />
                                                    <Routes exact path='/search/search-custom' component={SearchCustom} layout={SearchLayout} />
                                                    <Routes exact path='/search/search-general' component={SearchGeneral} layout={SearchLayout} />
                                                    <Routes exact path='/search/search-generic-article' component={SearchGenericArticle} layout={SearchLayout} />
                                                    <Routes exact path='/search/search-manufacturer' component={SearchManufacturer} layout={SearchLayout} />
                                                    <Routes exact path='/search/search-tyre' component={SearchTyre} layout={SearchLayout} />
                                                    <Routes exact path='/search/search-universal' component={SearchUniversal} layout={SearchLayout} />
                                                    <Routes exact path='/search/search-vehicles' component={SearchVehicles} layout={SearchLayout} />
                                                </Switch>

                                                {this.props.children}

                                                {/* Right column */}
                                                <div className="search__banner-container">
                                                    Right banner
                                                </div>
                                            </div>
                                        </section>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>

                    <footer className="ekat__footer">
                        <Footer />
                    </footer>
                </div>                
            </React.Fragment>
        );
    }
}
